		  <p class="step"><div class="body-text-Bold">Simsiz routerdagi [WPS] tugmasini xavfsizlik chirogʻi miltillamaguncha bosib turing.</div></p> 
		  <div class="images"><img src="../images/GUID-3209B2E0-5CF7-4314-8246-849632412CFA-web.png" border="0"></div> 
			  
		   
		   
			 <div class="body-text">[WPS] tugmasi qayerdaligini bilmasangiz yoki simsiz routerda tugmalar boʻlmasa, maʼlumot uchun router qoʻllanmasini koʻrib chiqing.</div>
